import store from './Store/store';
import { hot } from 'react-hot-loader/root';

// import {Socket} from './Socket'
function App() {
  return (
    <Provider store={store}>
   <Router>
     <div>
       <RouterPage></RouterPage>
       {/* <Socket></Socket> */}
     </div>
   </Router>
   </Provider>
  );
}

export default hot(App);
